const Card = (props) => {
    return (
      <div className="black">
        <div>
          <h3>{props.title}</h3>
          {props.title ? <div className="divider" />:""}
          {props.children}
          <img
            src="https://specials-images.forbesimg.com/imageserve/5d35eacaf1176b0008974b54/960x0.jpg?cropX1=790&cropX2=5350&cropY1=784&cropY2=3349.jpg"
            className="image"
          ></img>
          <h4>Here is a picture of a car. Isn't it cool!</h4>
        </div>
      </div>
    );
  };

const StoryTag = () => (
  <div className="black">
    <div className="">
      <h1>Top Story</h1>
    </div>
  </div>
);

const StoryCardContent = () => (
  <div className="black">
    <div className="wrapper">
      <Card title><h2>This Is 01</h2></Card>
      <Card><h2>This Is 02</h2></Card>
      <Card><h2>This Is 03</h2></Card>
    </div>
  </div>
);

const BodyContent = () => (
  <div className="black">
    <StoryTag />
    <StoryCardContent />
  </div>
);

export const Body = () => (
  <div className="center">
    <div className="cell inline">
      <BodyContent />
      <BodyContent />
    </div>
  </div>
);
